  function initHtml(data) {
    // Get countries data
    for (const countryData of data.countries) {
      const country = countryData.country;
      const zone = countryData.zone;

      if (zone) {
        const option = document.createElement("option");
        option.value = zone;
        option.text = `${country}`;
        document.getElementById("countrySelect").appendChild(option);
      }
    }

    // Debug Info
    let cnt = 0;
    data.countries.forEach(country => {
      if (!country.hasOwnProperty("zone")) {
        cnt++;
      }
    });

    document.getElementById(
      "debugInfo"
    ).innerHTML = `Countries that does not exist in DB: <span class="badge badge-warning">${cnt}</span>`;

    // Fuel Tax init 18%
    $("#fuelTax").val(18);
  }

